INSERT INTO `artikel` (`artikel_id`, `name`, `preis`, `bild`, `beschreibung`, `kategorie_id`) VALUES
(6, 'Harry Potter', 5.99, , 'Bis zu seinem elften Geburtstag glaubt Harry, er sei ein ganz normaler Junge. Doch dann erfährt er, dass er sich an der Schule für Hexerei und Zauberei einfinden soll – denn er ist ein Zauberer! In Hogwarts stürzt Harry von einem Abenteuer ins nächste und muss gegen Bestien, Mitschüler und Fabelwesen kämpfen. Da ist es gut, dass er schon Freunde gefunden hat, die ihm im Kampf gegen die dunklen Mächte zur Seite stehen.', 3);
INSERT INTO `artikel` (`artikel_id`, `name`, `preis`, `bild`, `beschreibung`, `kategorie_id`) VALUES
(8, 'Der Herr der Ringe: 3 Bände', 88.89, , 'Zum Jubiläum der Erstveröffentlichung des »Herr der Ringe« vor 50 Jahren veröffentlicht der Verlag eine dreibändige gebundene Ausgabe in klassischer Ausstattung und in der Übersetzung von Margaret Carroux. ', 3);
INSERT INTO `artikel` (`artikel_id`, `name`, `preis`, `bild`, `beschreibung`, `kategorie_id`) VALUES
(9, 'Der Hobbit', 24, , 'Ohne große Ansprüche lebt Bilbo Beutlin im Auenland, bis er von dem Zauberer Gandalf und einer Horde Zwerge aus seiner Beschaulichkeit und seinem gemütlichen Alltag gerissen wird. Auf einmal findet er sich mitten in einem Abenteuer wieder, das ihn zu dem riesigen und gefährlichen Drachen Smaug führt, der einen kostbaren Schatz in seinen Besitz gebracht hat und eifersüchtig hütet ... Mit 26 Farbtafeln und 38 Schwarzweißzeichnungen des bekannten Tolkienkünstlers Alan Lee, der für den Herr-der-Ringe-Film maßgeblich die Visualisierung von Tolkiens Welt und Figuren gestaltet hat. Alen Lee, geboren 1947 in Middlesex, gilt als einer der bedeutendsten Illustratoren der Werke J. R. R. Tolkiens. Für seine Designs der Herr-der-Ringe-Filmtrilogie wurde er 2004 mit dem Oscar ausgezeichnet.', 3);
INSERT INTO `artikel` (`artikel_id`, `name`, `preis`, `bild`, `beschreibung`, `kategorie_id`) VALUES
(10, 'Der Kleine Prinz', 3.95, , 'Als der Berufspilot und Schriftsteller Antoine de Saint-Exupéry im Jahr 1943 seinen ‘Kleinen Prinzen’ erfand, konnte er nicht ahnen, welch gewaltiger Welterfolg sein Büchlein werden sollte. Die philosophisch-poetische Geschichte vom kleinen Prinzen, der auf der Suche nach Freunden allerlei seltsame Planeten bereist, übt ungebrochene Faszination aus. Das moderne Märchen berührt mit seinem Plädoyer für Menschlichkeit Leserinnen und Leser jeden Alters und wurde vom Autor selbst mit Illustrationen versehen. Das ideale Buch zum Verschenken oder Geschenktbekommen.', 3);
INSERT INTO `artikel` (`artikel_id`, `name`, `preis`, `bild`, `beschreibung`, `kategorie_id`) VALUES
(11, 'Schwenkbare LED Deckenleuchte', 19.99, , 'Dieser LED Deckenstrahler in titanfarben fügt sich mit dem schlichten Design in jeden Wohnraum ein. Für Kinderzimmer, Schlafzimmer, Wohnzimmer, oder als Küchenlampe. Die Spots der Leuchte sind dreh- und schwenkbar und sorgen für individuelle Ausleuchtung. ', 4);
