INSERT INTO `artikel` (`artikel_id`, `name`, `preis`, `bild`, `beschreibung`, `kategorie_id`) VALUES
(13, 'Iphone 13', 1209, , '6,1\" Super Retina XDR Display mit ProMotion, das alles schneller und flüssiger macht; Der Kinomodus fügt automatisch geringe Tiefenschärfe hinzu und verschiebt den Fokus in deinen Videos; Pro Kamera-System mit neuen 12 MP Tele , Weitwinkel  und Ultraweitwinkel-Objektiven; LiDAR Scanner; 6x optischer Zoombereich; Makrofotografie; Fotografische Stile, ProRes Video, Smart HDR 4, Nachtmodus, Apple ProRAW, 4K HDR Aufnahme mit Dolby Vision; 12 MP TrueDepth Frontkamera mit Nachtmodus, 4K HDR Aufnahme mit Dolby Vision; A15 Bionic Chip für superschnelle Performance; Bis zu 22 Std. Videowiedergabe; Robustes Design mit Ceramic Shield; Branchenführender IP68 Wasserschutz; 5G für superschnelle Downloads und Streaming in höchster Qualität; iOS 15 ist vollgepackt mit neuen Features, damit du mehr mit dem iPhone machen kannst als je zuvor', 5);
INSERT INTO `artikel` (`artikel_id`, `name`, `preis`, `bild`, `beschreibung`, `kategorie_id`) VALUES
(14, 'Neu Apple AirPods (3. Generation) ', 171, , '3D Audio mit dynamischem Head Tracking. Für Sound überall um dich herum; Adaptiver EQ, der Musik automatisch an deine Ohren anpasst; Neues konturiertes Design; Steuere mit dem Drucksensor dein Entertainment, nimm Anrufe an, beende sie und mehr; Vor Schweiß und Wasser geschützt; Bis zu 6 Std. Wiedergabe mit einer Aufladung; Bis zu 30 Std. Wiedergabe mit dem MagSafe Ladecase; Schneller Zugriff auf Siri, indem du einfach „Hey Siri“ sagst; Einfaches Setup, In-Ear Erkennung und automatisches Wechseln für ein fast magisches Erlebnis; Teile Audio ganz einfach zwischen zwei Paar AirPods auf deinem iPhone, iPad, iPod touch oder Apple TV', 5);
INSERT INTO `artikel` (`artikel_id`, `name`, `preis`, `bild`, `beschreibung`, `kategorie_id`) VALUES
(15, 'Gillette SkinGuard Sensitive Nassrasierer Herren, Rasierer + 4 Rasierklingen mit Flexgriff und Hautschutz', 10.79, , 'Die Rasierklingen für den Nassrasierer für Herren sind klinisch geprüft für empfindliche Haut; Unterstützt die Vermeidung von Rasurbrand und Hautirritationen, auch an den Konturen; Passt sich Gesichtskonturen an und sorgt für eine angenehme Rasur dank FlexBall-Technologie; Feuchtigkeitsstreifen vor und nach den Klingen schützen die Haut während der Rasur; Glättet und schützt die Haut dank einzigartigem SkinGuard-Element zwischen den Klingen; Präzisionstrimmer für schwer zu erreichende Stellen und Bartstyling; Mit Klingen hergestellt im Berliner Gillette Werk (Made in Germany); In recyclebarer und FSC-zertifizierter Kartonpackung ', 6);
INSERT INTO `artikel` (`artikel_id`, `name`, `preis`, `bild`, `beschreibung`, `kategorie_id`) VALUES
(16, 'NIVEA Classic Mild Shampoo (250 ml), pflegendes Haarshampoo mit Baumwollsamen-Öl, mild reinigendes Pflegeshampoo für normales Haar', 1.95, , 'Classic Mild – Das klassisch milde NIVEA Classic Shampoo pflegt normales Haar sanft und sorgt für einen gesunden Glanz und leichtere Kämmbarkeit; Mit Baumwollsamen-Öl – Bei jeder Anwendung pflegt das NIVEA Shampoo mit wertvollem Baumwollsamen-Öl das Haar gesund, ohne es dabei zu beschweren; pH-Balance – Dank seiner pH-optimierten Formel ist das Shampoo besonders mild zu Haar und Kopfhaut und harmoniert mit dem natürlichen pH-Wert; Sanfte Reinigung – Das milde Shampoo reinigt die Kopfhaut sanft. Zudem stärkt es die Haarstruktur und sorgt so für eine verbesserte Widerstandskraft; Lieferumfang & Details – NIVEA Classic Mild Shampoo (250 ml), für normales Haar, Artikelnummer 81441 ', 6);
INSERT INTO `artikel` (`artikel_id`, `name`, `preis`, `bild`, `beschreibung`, `kategorie_id`) VALUES
(17, 'Intel i7 4770 8-Thread Business Office Multimedia Computer mit 3 Jahren Garantie!', 390.9, , 'Das Gerät ist mit einem sehr schnellen i7 8-Thread Prozessor sowie schnellen 16GB Markenarbeitsspeicher ausgestattet, die mehr als genug Leistung für rechenintensive Anwendungen, Multitasking und Multimedia bereitstellen. Die große 256 GB SSD + 1TB sind ideal um all ihre Daten zu speichern. Der schnelle DVD-Brenner sichert zuverlässig alles auf CD oder DVD. Der PC verfügt über USB 3.0 Anschlüsse und hat bereits WLAN, sie können sofort lossurfen. Arbeiten Sie in Ruhe, ohne störende Lüfter-Geräusche! Das Gerät verfügt über ein Silent Netzteil und einen geregelten, leisen CPU Kühler. Der PC wird mit Betriebssystem geliefert, Microsoft Windows 11 Professional 64Bit ist inkl. aller Treiber fertig installiert. Um Viren und andere Schädlinge zuverlässig abzuwehren ist die neueste GDATA Internet Security installiert inkl. einem halben Jahr Updates. Außerdem ist MS Office 2010 Starter (Word 2010 und Excel 2010 ) als Vollversion enthalten.', 7);
INSERT INTO `artikel` (`artikel_id`, `name`, `preis`, `bild`, `beschreibung`, `kategorie_id`) VALUES
(18, '15,6 Zoll Laptop, Notebook, Computer PC, J4115/J4125 Quad Core CPU, Windows 10 Pro Betriebssystem, 8 GB RAM, 128 GB ROM(Erweiterbarer 1 TB SSD), 50Wh Batterie, 1920X1080 Full HD Anzeige, Bluetooth', 239, , 'Auf dem Laptop ist das Betriebssystem Windows 10 Pro vorinstalliert, das eine hervorragende Sicherheitsleistung bietet, und eine vereinfachte Benutzeroberfläche verbessert die Benutzerfreundlichkeit. (Hinweis: Aufgrund des neuesten Windows-Betriebssystem Updates beträgt die maximale Aktualisierungszeit 48 Stunden. Um ein \"langes Warten auf das Update\" zu vermeiden, \"überspringen Sie bitte die WLAN Verbindung\", wenn Sie den Assistenten zum ersten Mal starten. Das 15,6 Zoll IPS Full HD Display verfügt über ein breiteres Sichtfeld und eine ultrahochauflösende Auflösung von 1920 * 1080. Es kann lebendige Details und ein klareres visuelles Erlebnis bringen. Das Bildschirm-zu-Körper-Verhältnis von 90% bietet Ihnen ein breiteres Sichtfeld, selbst bei starker Außenbeleuchtung. Darüber hinaus tragen der Nachtmodus und die Farbanpassung dazu bei, die Belastung der Augen zu verringern. Dieser Notebook Computer ist mit einem mobilen Intel J4125 / J4115 Prozessor (bis zu 2,5 GHz) ausgestattet. Ein Laptop kann alle Aspekte der täglichen Berechnungen verarbeiten, egal wie kompliziert er ist, er kann jede Arbeit erledigen. J4125 / J4115 verwenden eine fortschrittlichere Architektur, die 50% schneller als J3455 und N3450 ist, und die Kreativität hat mit erstaunlicher Geschwindigkeit neue Höhen erreicht. Eine 50-Wh-Lithium-Polymer-Batterie kann 8 Stunden lang verwendet werden, um ein besseres Arbeits- und Unterhaltungserlebnis zu bieten. Sie können Ihren Laptop für längere Zeit mitnehmen und mehrere Aufgaben ausführen. Der Laptop wiegt 1,5 Kilogramm und ist 0,6 Zoll dick. Die Schokoladentastatur in voller Größe ist elegant, und leicht. Es ist die beste Wahl für Geschäftsstellen, kreatives Design, Audio- und Videounterhaltung.', 7);
INSERT INTO `artikel` (`artikel_id`, `name`, `preis`, `bild`, `beschreibung`, `kategorie_id`) VALUES
(19, '2020 Apple MacBook Air mit Apple M1 Chip (13\", 8 GB RAM, 256 GB SSD) - Space Grau ', 959.99, , 'Von Apple designter M1 Chip für einen gigantischen Leistungssprung bei CPU und GPU und maschinellem Lernen; Mach mehr als je zuvor mit bis zu 18 Std. Batterielaufzeit; Die 8 Core CPU liefert eine bis zu 3,5x schnellere Performance, um Projekte schneller als je zuvor zu erledigen; Bis zu acht GPU Kerne mit bis zu 5x schnellerer Grafik für grafikintensive Apps und Games; 16 Core Neural Engine für fortschrittliches maschinelles Lernen; 8 GB gemeinsamer Arbeitsspeicher, damit alles, was du machst, schnell und flüssig geht; Superschneller SSD Speicher startet Apps und öffnet Dateien sofort ', 7);
