(21, 'Amigo Spiel + Freizeit 1700 Halli Galli. Auf die Glocke-fertig-los! ', 9.89, , 'Das rasante Reaktionsspiel für die ganze Familie! Da haben wir den Salat. Ein großer Fruchtcocktail mit Bananen, Erdbeeren, Limonen und Pflaumen – das ist Halli Galli! Schnelligkeit und ein gutes Auge sind hier Trumpf. Sobald Sie fünf gleiche Früchte auf den ausgespielten Karten entdecken, schlagen Sie schnell auf die Klingel. Wer am Ende die meisten Karten erklingelt hat, gewinnt!', 8);
