INSERT INTO `artikel` (`artikel_id`, `name`, `preis`, `bild`, `beschreibung`, `kategorie_id`) VALUES
(23, 'LEGO 75288 Star Wars at-at, Walker Spielzeug, Set zum 40. Jubiläum für Kinder und Erwachsene ', 133.89, , 'Optimierte Versandverpackung. Dein LEGO Set wird durch eine recyclebare Versandverpackung geschützt, so dass der Karton des Sets nicht beschädigt wird. Der Inhalt des Pakets wird durch einen Aufdruck auf der Versandverpackung offenbart. Fans der klassischen Star Wars Trilogie und des Videospiels „LEGO Star Wars: Die Skywalker Saga“ werden mit großer Begeisterung die Schlacht auf Hoth mit dieser detailreichen, beweglichen Version des legendären AT-AT Walkers (75288) aus LEGO Steinen nachstellen. Dieses unterhaltsame und kreative Bauspielzeug für Kinder enthält 6 LEGO Star Wars Minifiguren – Luke Skywalker, General Veers, 2 AT-AT Drivers und 2 Snowtroopers mit Ausrüstung –, um das Kräftemessen zwischen dem Imperium und der Rebellenallianz als actionreiche Rollenspiele nachzustellen. Der AT-AT verfügt über ein Cockpit für 3 LEGO Minifiguren, aufklappbare Seitenwände, Shooter mit Federmechanismus, einen Speeder, eine Seilwinde, eine Bodenluke, in die Luke seinen Thermaldetonator hineinwerfen kann, sowie weitere Zubehörelemente, die ein realistisches, kreatives Spielerlebnis ermöglichen. Dieses 1.267-teilige Set ist ein tolles Geburtstags- oder Weihnachtsgeschenk oder eine besondere Belohnung für Jungen und Mädchen ab 10 Jahren, die sich auf eine spannende Bauherausforderung und stundenlangen Spielspaß freuen, den sie allein oder zusammen mit anderen erleben könnenDer AT-AT Walker ist 34 cm hoch, 38 cm lang und 15 cm breit. Fans können den AT-AT Walker auch im Videospiel „LEGO Star Wars: Die Skywalker Saga“ steuern. Für den AT-AT Walker aus diesem Star Wars Bauset werden keine Batterien benötigt. Er besteht ausschließlich aus LEGO Steinen, und als Antrieb für unzählige galaktische Abenteuer und kreatives Spielvergnügen reicht dem AT-AT die Fantasie der Kinder. LEGO Star Wars Sets sind tolle Bauspielzeuge und Schaustücke, mit denen Kinder und erwachsene Fans die Szenen aus der klassischen Star Wars Trilogie nachstellen oder sich eigene spannende Missionen ausdenken können. Für jeden Fan ist etwas dabei! ', 10);
